// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract DefiBank {

    uint256 startTime;
    uint256 endTime;

    address public Admin = 0xB268C07881a418D0BcADCF7204CeBc6D68A54904;
    address public USD = 0x634023f90821203fE788A4F051FeEF20B8353184;
    address public soren = 0xC07FEc71bbc111C6fC9C33da2cbEA586469b9097;

    mapping(address => bool) deposeted;
    mapping(address => uint256) balances;

    event deposit(address staker, address token, uint256 amount);
    event WithDraw(address staker, address token, uint256 amount, uint256 profit_amount);


    constructor(){

        startTime = block.timestamp;
        endTime = startTime + 7 days;

    }


    function stake(uint256 amount) public payable{

        require(block.timestamp >= startTime, 'too early');
        require(deposeted[msg.sender] == false, 'You can not invest twice');

        bool success = IERC20(USD).transferFrom(msg.sender, address(this), amount);
        require(success == true, "transfer failed!");

        deposeted[msg.sender] = true;
        balances[msg.sender] += amount;

        emit deposit(msg.sender, USD, amount);

    }


    function withdraw() public payable{

        require(block.timestamp >= endTime, 'too early');
        require(balances[msg.sender] > 0, 'insufficient balance');

        uint256 balance = balances[msg.sender];
        balances[msg.sender] = 0;

        IERC20(soren).transfer(msg.sender, balance / 100);
        IERC20(USD).transfer(msg.sender, balance);

        emit WithDraw(msg.sender, USD, balance, balance/100);
    }


    function getbalance(address user) public view returns(uint256){

        return balances[user];
    }
}
